import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import React, { useContext } from 'react';
import { AuthContext } from '../Login/AuthContext';
import { Dropdown } from 'react-bootstrap';

const NavBar = () => {
  const navigate = useNavigate();
  // const { status , setStatus} = useContext(AuthContext);
  const Auth = useContext(AuthContext);
  const handleLogout = () => {
    localStorage.setItem('loggedIn', 'false');
    localStorage.removeItem('token');
    // setStatus(false);
    Auth.setIsLoggedIn(false);
    navigate('/');
  };

  return (
    <header>
      <nav className="navbar navbar-expand-lg navbar-dark " style={{ backgroundColor: '#47345F' }}>
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">Logo</Link>
  
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav"
            aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav mx-auto">
            <li className="nav-item">
                <Link className="nav-link" to="/">หน้าหลัก</Link>
              </li>
              {Auth.isLoggedIn ? (
  // ส่วนของโค้ดสำหรับผู้ใช้ที่เข้าสู่ระบบแล้ว
  <ul className="navbar-nav mx-auto">
    {/* ... */}
    <li className="nav-item">
      <Link className="nav-link" to="/Booking">การจอง</Link>
    </li>
    <li className="nav-item">
      <Link className="nav-link" to="/CusData">ข้อมูลลูกค้า</Link>
    </li>
    {/* ... */}
  </ul>
) : (
  // ส่วนของโค้ดสำหรับผู้ใช้ที่ยังไม่ได้เข้าสู่ระบบ
  <ul className="navbar-nav mx-auto">
    {/* ... */}
    <li className="nav-item" style={{ display: 'none' }}>
      <Link className="nav-link" to="/Booking">การจอง</Link>
    </li>
    <li className="nav-item" style={{ display: 'none' }}>
      <Link className="nav-link" to="/CusData">ข้อมูลลูกค้า</Link>
    </li>
    {/* ... */}
  </ul>
)}
              <li className="nav-item">
                <Link className="nav-link" to="/Housing">โครงการ</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/AboutUs">เกี่ยวกับเรา</Link>
              </li>
            </ul>
            <ul className="navbar-nav ms-auto">
              <li className="nav-item me-3">
                {Auth.isLoggedIn ? (
                <p>
      <Dropdown align="end" >
      <Dropdown.Toggle variant="secondary" id="profile-dropdown">User Profile </Dropdown.Toggle>
      <Dropdown.Menu>
      <Dropdown.Item > <Link className="" to="/UserProfile">My Profile</Link></Dropdown.Item>
        <Dropdown.Item to="/UserProfile">My Profile</Dropdown.Item>
        <Dropdown.Item href="/settings">Settings</Dropdown.Item>
        <Dropdown.Divider />
        <Dropdown.Item onClick={handleLogout}>Logout</Dropdown.Item>
      </Dropdown.Menu>
      </Dropdown>
                  </p>
                ) : (
                  <>
                  <button className="btn btn-outline-light"> <Link className="nav-link" to="/LoginForm">เข้าสู่ระบบ</Link> </button>
                  <button className="btn btn-outline-light"> <Link className="nav-link" to="/Register">สมัครสมาชิก</Link> </button>
                  </>
                )}
              </li>
            </ul>
          </div>
        </div>
      </nav>
    </header>
  );
};

export default NavBar;
